import React, { useContext, useEffect, useState } from "react";

import { PetEventsProvider } from "./PetEventsContext";
import Axios from "axios";
import DataTable from "./DataTable/DataTables";

import { AuthContext } from "../../AuthContext";

//Import Breadcrumb
import Breadcrumbs from "../../components/Common/Breadcrumb";

import "./PetEvents.scss";

const PetEvents = () => {
  const { token } = useContext(AuthContext);
  const [eventsData, setEventsData] = useState([]);
  const tokenValue = String(localStorage.getItem("jwtToken"));
  const [jwtToken, setJwtToken] = token;
  setJwtToken(tokenValue);

  const apiUrl = "http://18.216.174.90:3000";
  const getEventsUrl = `${apiUrl}/api/event`;

  const config = {
    headers: {
      Authorization: `Bearer ${jwtToken}`,
    },
  };

  useEffect(() => {
    Axios.get(getEventsUrl, config).then((response) => {
      setEventsData(response.data);
    });
  }, []);

  return (
    <PetEventsProvider>
      <React.Fragment>
        <div className="page-content">
          <div className="container-fluid">
            <Breadcrumbs title="Pet Events" />
            <DataTable token={jwtToken} data={eventsData} />
          </div>
        </div>
      </React.Fragment>
    </PetEventsProvider>
  );
};

export default PetEvents;
